import React from 'react';
import { useParams } from 'react-router-dom';

const UpdateRestaurant = (props) => {

    const {id} = useParams();

    return (
        <div>
            <form action="">
                <div className="form-group">
                    <label htmlFor="name">Name</label>
                    <input  type="text"/>
                </div>
            </form>
        </div>
    )
}

export default UpdateRestaurant;
